<script>
    import { mapState } from "vuex";

    export default {
        data() {
            return {
                show_dropdown: false,
            }
        },
        computed: mapState({
            cur: state => state.home.cur,
        }),

        methods: {
            CHANGE_CUR(cur, sym) {
                this.$store.commit('SET_CUR', {cur: cur, sym: sym});
                this.$store.commit('GET_CUR');
                this.cur = cur;
            },

            CHANGE_LANG(lang) {
                this.$i18n.locale = lang;
                localStorage.setItem('lang', lang);
            }
        }
    }
</script>